//import logo from './logo.svg';
import './App.css';
import Hero from './Componentes/Hero';

const Social = () => <div>Social</div>;
const ContactUs = () => <div>Contacto</div>;
const Footer = () => <div>Footer</div>;

function App() {
  return (
    <>
      <Hero />
      <Social />
      <ContactUs />
      <Footer />
    </>
  );
}

export default App;
